import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles({
  card: {
    maxWidth: 345,
  },
  media: {
    height: 140,
  },
});

export default function MediaCard() {
  const classes = useStyles();

  return (
    <div>
    <Card className={classes.card}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image="/static/images/cards/contemplative-reptile.jpg"
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            Try Not To Die
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
          Try Not To Die is a health app that encourages healthy habits. It matches users with workout buddies, healthy recipes, and information about preventative services.
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary"><a href="https://github.com/funkadelic83/try-not-to-die">
          GitHub </a>
         </Button>
      </CardActions>
    </Card>
    <Card className={classes.card}>
    <CardActionArea>
      <CardMedia
        className={classes.media}
        image="/static/images/cards/contemplative-reptile.jpg"
        title="Contemplative Reptile"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="h2">
          Amazon Storefront
        </Typography>
        <Typography variant="body2" color="textSecondary" component="p">
        Try Not To Die is a health app that encourages healthy habits. It matches users with workout buddies, healthy recipes, and information about preventative services.
        </Typography>
      </CardContent>
    </CardActionArea>
    <CardActions>
      <Button size="small" color="primary"><a href="https://github.com/funkadelic83/try-not-to-die">
        GitHub </a>
       </Button>
    </CardActions>
  </Card>
  </div>
  );
}
